{
  "openapi": "3.0.1",
  "info": {
    "title": "DDA",
    "version": "1.0.0",
    "description": "API para serviços do Débito Direto Autorizado e apresentação eletrônica de obrigações",
    "contact": {
      "url": "https://developers.bb.com.br",
      "name": "Banco do Brasil S.A. - BB for Developers"
    }
  },
  "externalDocs": {
    "url": "https://developers.bb.com.br/docs"
  },
  "servers": [
    {
      "url": "https://api.desenv.bb.com.br/dda/v1",
      "description": "Desenvolvimento"
    },
    {
      "url": "https://api.hm.bb.com.br/dda/v1",
      "description": "Homologação"
    },
    {
      "url": "https://api.bb.com.br/dda/v1",
      "description": "Produção"
    }
  ],
  "components": {
    "schemas": {},
    "securitySchemes": {
      "OAuth2-ClientCredentials": {
        "type": "oauth2",
        "flows": {
          "clientCredentials": {
            "tokenUrl": "https://oauth.desenv.bb.com.br/oauth/token",
            "refreshUrl": "https://oauth.desenv.bb.com.br/oauth/token",
            "scopes": {
              "dda-info": "Realizar consultas relativas a Débito Direto Autorizado e apresentação eletrônica de obrigações"
            }
          }
        },
        "description": "Com a proteção de credenciais de usuários, o OAuth 2.0 permite a recuperação segura de recursos seguros."
      }
    },
    "responses": {
      "Erro": {
        "description": "Representa os campos de erro de uma requisição a um recurso.",
        "content": {
          "application/json": {
            "schema": {
              "type": "object",
              "properties": {
                "erros": {
                  "type": "array",
                  "uniqueItems": true,
                  "minItems": 1,
                  "description": "Lista que contém os objetos de erro",
                  "items": {
                    "type": "object",
                    "properties": {
                      "codigo": {
                        "type": "string",
                        "description": "Código da mensagem de erro",
                        "example": "9999999"
                      },
                      "versao": {
                        "type": "string",
                        "description": "Versão da mensagem de erro",
                        "example": "1"
                      },
                      "mensagem": {
                        "type": "string",
                        "description": "Mensagem de erro",
                        "example": "Erros do tipo 4XX são erros de chamada de responsabilidade de quem está acionando este recurso. Erros do tipo 5XX são erros internos no BB."
                      },
                      "ocorrencia": {
                        "type": "string",
                        "description": "Código da ocorrência do erro. Não se trata de código HTTP",
                        "example": "2AzBShK/zFE=C0700051620C"
                      }
                    },
                    "required": [
                      "codigo",
                      "versao",
                      "mensagem",
                      "ocorrencia"
                    ]
                  }
                }
              },
              "required": [
                "erros"
              ]
            },
            "examples": {
              "example-1": {
                "value": {
                  "erros": [
                    {
                      "codigo": "9999999",
                      "versao": "1",
                      "mensagem": "Erros do tipo 4XX são erros de chamada de responsabilidade de quem está acionando este recurso. Erros do tipo 5XX são erros internos no BB.",
                      "ocorrencia": "2AzBShK/zFE=C0700051620C"
                    }
                  ]
                }
              }
            }
          }
        },
        "headers": {
          "Content-type": {
            "schema": {
              "type": "string"
            },
            "description": "application/json"
          }
        }
      },
      "ErrorOAuthUnauthorized": {
        "description": "Representação de um objeto de erro do OAuth 2.0.",
        "content": {
          "application/json": {
            "schema": {
              "properties": {
                "statusCode": {
                  "type": "number",
                  "description": "Código do estado do erro."
                },
                "error": {
                  "type": "string",
                  "description": "Tipo do erro."
                },
                "message": {
                  "type": "string",
                  "description": "Mensagem do erro."
                },
                "attributes": {
                  "type": "object",
                  "description": "Atributos do erro.",
                  "properties": {
                    "error": {
                      "type": "string",
                      "description": "Mensagem do erro."
                    }
                  }
                }
              }
            },
            "examples": {
              "example-1": {
                "value": {
                  "statusCode": 401,
                  "error": "Unauthorized",
                  "message": "Bad Credentials",
                  "attributes": {
                    "error": "Bad Credentials"
                  }
                }
              }
            }
          }
        },
        "headers": {
          "Content-type": {
            "schema": {
              "type": "string"
            },
            "description": "application/json"
          }
        }
      },
      "consultaBoletosPagador": {
        "description": "",
        "content": {
          "application/json": {
            "schema": {
              "type": "object",
              "properties": {
                "numeroIdentificadorPagador": {
                  "type": "integer",
                  "description": "Número referente ao CPF/CNPJ do pagador",
                  "example": 74910037000193,
                  "format": "int64"
                },
                "codigoTipoPessoaPagador": {
                  "type": "string",
                  "example": "J",
                  "description": "Código referente ao tipo de pessoa (PF ou PJ) do pagador:\nJ - jurídica/ F- física",
                  "enum": [
                    "J",
                    "F"
                  ]
                },
                "indicadorContinuidade": {
                  "type": "string",
                  "example": "S",
                  "description": "Indicador de que a consulta resultou em uma quantidade superior a XXX boletos (capacidade de resposta por requisição do serviço). Uma nova requisição, nos mesmos moldes, deve ser feita para consultar o restante dos boletos. Para tanto, deverá ser utilizado o valor informado no atributo \"Número Último Registro\" como valor inicial da próxima consulta",
                  "enum": [
                    "S",
                    "N"
                  ]
                },
                "dataVencimentoInicial": {
                  "type": "string",
                  "example": "29.04.2022",
                  "description": "Data de vencimento incial que delimita o período"
                },
                "dataVencimentoIFinal": {
                  "type": "string",
                  "description": "Data de vencimento final que delimita o período",
                  "example": "29.05.2022"
                },
                "codigoEstadoObrigacao": {
                  "type": "integer",
                  "example": 1,
                  "description": "Código do estado da obrigação:\n 1- A pagar; 2 -> Agendado; 3 -> Liquidado",
                  "format": "int32",
                  "enum": [
                    1,
                    2,
                    3
                  ]
                },
                "numeroProximoRegistro": {
                  "type": "integer",
                  "example": 151,
                  "description": "Número do último registro apresentado pela lista, que poderá ser utilizado como parâmetro inicial de uma nova requisição para consultar os boletos restantes",
                  "format": "int64"
                },
                "quantidadeListaTitulo": {
                  "type": "integer",
                  "example": 150,
                  "description": "Campo correspondente a quantidade de registros encontrados para o período pesquisado",
                  "format": "int64"
                },
                "listaTitulo": {
                  "type": "array",
                  "items": {
                    "type": "object",
                    "properties": {
                      "codigoBarrasObrigacao": {
                        "type": "string",
                        "example": "0019189700000 0032360000003 1285576190961 88117",
                        "description": "Refere-se ao código de barras do boleto (obrigação)"
                      },
                      "dataVencimentoObrigacao": {
                        "type": "string",
                        "example": "29.04.2022",
                        "description": "Data de vencimento do boleto (orbigação)"
                      },
                      "valorObrigacao": {
                        "type": "number",
                        "format": "double",
                        "example": 32.36,
                        "description": "Valor de face do boleto (obrigação)"
                      },
                      "codigoDocumentoObrigacao": {
                        "type": "string",
                        "example": "19096",
                        "description": "Número adotado e controlado pelo Cliente, para identificar o título de cobrança. Para uso do Banco. Seu Número"
                      },
                      "numeroIdentificadorBeneficiario": {
                        "type": "integer",
                        "format": "int64",
                        "example": 89134853000120,
                        "description": "Número referente ao CPF/CNPJ do beneficiário"
                      },
                      "codigoTipoPessoaBeneficiario": {
                        "type": "string",
                        "enum": [
                          "J",
                          "F"
                        ],
                        "example": "J",
                        "description": "Código referente ao tipo de pessoa (PF ou PJ) do beneficiário"
                      },
                      "nomeBeneficiario": {
                        "type": "string",
                        "example": "BELFORT GERENCIAME NTO DE RESIDUOS LTDA",
                        "description": "Nome do beneficiário do boleto"
                      },
                      "numeroIdentificadorSacadorAvalista": {
                        "type": "integer",
                        "format": "int64",
                        "example": 98959112000179,
                        "description": "Número referente ao CPF/CNPJ do beneficiário final do boleto (sacador/avalista)"
                      },
                      "codigoTipoPessoaSacadorAvalista": {
                        "type": "string",
                        "description": "Código referente ao tipo de pessoa (PF ou PJ) do beneficiário final do boleto (sacador/avalista)",
                        "enum": [
                          "J",
                          "F"
                        ],
                        "example": "J"
                      },
                      "nomeSacadorAvalista": {
                        "type": "string",
                        "description": "Nome do beneficiário final do boleto (sacador/avalista)",
                        "example": "MEIRELUCIA ALMEIDA EIRELI"
                      },
                      "dataRegistroObrigacao": {
                        "type": "string",
                        "example": "01.04.2022",
                        "description": "Data de emissão do boleto"
                      }
                    }
                  }
                }
              }
            },
            "examples": {
              "example-1": {
                "value": {
                  "numeroIdentificadorPagador": 74910037000193,
                  "codigoTipoPessoaPagador": "J",
                  "indicadorContinuidade": "S",
                  "dataVencimentoInicial": "29.04.2022",
                  "dataVencimentoIFinal": "29.05.2022",
                  "codigoEstadoObrigacao": 1,
                  "numeroProximoRegistro": 151,
                  "quantidadeListaTitulo": 150,
                  "listaTitulo": [
                    {
                      "codigoBarrasObrigacao": "0019189700000 0032360000003 1285576190961 88117",
                      "dataVencimentoObrigacao": "29.04.2022",
                      "valorObrigacao": 32.36,
                      "codigoDocumentoObrigacao": "19096",
                      "numeroIdentificadorBeneficiario": 89134853000120,
                      "codigoTipoPessoaBeneficiario": "J",
                      "nomeBeneficiario": "BELFORT GERENCIAME NTO DE RESIDUOS LTDA",
                      "numeroIdentificadorSacadorAvalista": 98959112000179,
                      "codigoTipoPessoaSacadorAvalista": "J",
                      "nomeSacadorAvalista": "MEIRELUCIA ALMEIDA EIRELI",
                      "dataRegistroObrigacao": "01.04.2022"
                    }
                  ]
                }
              }
            }
          }
        }
      }
    },
    "parameters": {
      "gw-dev-app-key": {
        "name": "gw-dev-app-key",
        "in": "query",
        "required": true,
        "schema": {
          "type": "string",
          "example": "0021239456d80136bebf005056891bed"
        },
        "description": "É a chave de acesso do aplicativo do desenvolvedor obtida no Portal do Desenvolvedor. Essa chave será usada para identificação do aplicativo."
      },
      "Authorization": {
        "name": "Authorization",
        "in": "header",
        "required": true,
        "schema": {
          "type": "string",
          "example": "Bearer <acess_token>"
        },
        "description": "É o valor do token de acesso fornecido pelo OAuth."
      }
    }
  },
  "tags": [
    {
      "name": "consultas"
    }
  ],
  "paths": {
    "/boletos": {
      "parameters": [],
      "get": {
        "summary": "Listar Boletos de um Pagador",
        "responses": {
          "200": {
            "$ref": "#/components/responses/consultaBoletosPagador"
          },
          "400": {
            "$ref": "#/components/responses/Erro"
          },
          "401": {
            "$ref": "#/components/responses/ErrorOAuthUnauthorized"
          },
          "403": {
            "$ref": "#/components/responses/ErrorOAuthUnauthorized"
          },
          "404": {
            "description": "Not Found"
          },
          "422": {
            "$ref": "#/components/responses/Erro"
          },
          "500": {
            "$ref": "#/components/responses/Erro"
          }
        },
        "operationId": "get-convenios-agenciaConvenio-contaConvenio-contas-integracao-agenciaCooperado-contaCooperado",
        "description": "Listar boletos de um pagador",
        "parameters": [
          {
            "$ref": "#/components/parameters/Authorization"
          },
          {
            "$ref": "#/components/parameters/gw-dev-app-key"
          },
          {
            "schema": {
              "type": "string",
              "example": "29.04.2022"
            },
            "in": "query",
            "name": "dataVencimentoInicial",
            "description": "Data de vencimento inicial que delimita o período",
            "required": true
          },
          {
            "schema": {
              "type": "string",
              "example": "29.05.2022"
            },
            "in": "query",
            "name": "dataVencimentoFinal",
            "description": "Data de vencimento final que delimita o período",
            "required": true
          },
          {
            "schema": {
              "type": "integer",
              "format": "int32",
              "example": 1,
              "enum": [
                1,
                2,
                3
              ]
            },
            "in": "query",
            "name": "codigoEstadoObrigacao",
            "description": "Código do estado da obrigação, pode ser 1- A pagar; 2 -> Agendado; 3 -> Liquidado",
            "required": true
          },
          {
            "schema": {
              "type": "integer",
              "format": "int32",
              "example": 1,
              "minimum": 1
            },
            "in": "query",
            "name": "numeroProximoRegistro",
            "description": "Número do último registro apresentado pela lista, que poderá ser utilizado como parâmetro inicial de uma nova requisição para consultar os boletos restantes.",
            "required": true
          }
        ],
        "security": [
          {
            "OAuth2-ClientCredentials": [
              "cooperativas-info"
            ]
          }
        ],
        "tags": [
          "consultas"
        ]
      }
    }
  }
}
